    [SerializeField]
    private GameObject BlockPrefab;
    // Use this for initialization
    void Awake()
    {
      
            RefineMaze(maze);
        
    }
    void Start () {

       



    }
	
	// Update is called once per frame
	void Update () {
        if (!IsMade)
        {
            IsMade = true;
            AllocateBlocks(maze);
            
        }
    }
  
    public void RefineMaze(int[,] maze)
    {
        for (int j = 0; j < MAXWIDTH; j++) //1. 사이에 끼는 오브젝트 제거
        {
            for (int i = 0; i < MAXHEIGHT; i++)
            {
                if (maze[i, j] != 0 && j != 0 && j != MAXWIDTH-1)
                {
                    if (maze[i, j - 1] == 1 && maze[i, j + 1] == 1)
                        maze[i, j] = 0;
                }
               

               

            }
        }

        for (int j = 0; j < MAXWIDTH; j++) //2. 모양에 맞게 블록들이 잘 결합하도록 처리
        {
            for (int i = 0; i < MAXHEIGHT; i++)
            {
                if (maze[i, j] != 0)
                {
                    if(j == 0) //첫 열 일때 (윗 픽셀값과만 비교하면 됨)
                    {
                        if (i != 0 && maze[i - 1, j] == 1) //해당 픽셀의 윗 픽셀이 1일 때
                            maze[i, j] = 0; //해당 픽셀 값을 0으로 교체   
                    }
                    else //두번째 이상의 열일 때 (위, 왼쪽 픽셀값과 비교)
                    {
                        if( i != 0) //위에 다른 픽셀이 있을 때
                        {
                            if ((j > 1 && maze[i, j - 2] == 1) || maze[i - 1, j] == 1) //위나 왼쪽의 픽셀이 1일 때
                                maze[i, j] = 0;
                            
                        }
                        else  //열의 가장 윗 픽셀일때
                        {
                            if (maze[i, j - 2] == 1) //왼쪽의 픽셀이 1일 때
                                maze[i, j] = 0;
                          
                        }
                        
                       
                    }
                }

                if (j != 0 && i != 0 && maze[i, j] != 0 && maze[i - 1, j - 1] == 1)
                    maze[i, j] = 0;
                if (j != 0 && i != MAXHEIGHT-1 && maze[i, j] != 0 && maze[i + 1, j - 1] == 1)
                    maze[i, j] = 0;

                if (maze[i, j] != 0 && j != 0 && j != MAXWIDTH - 1)
                {
                    if ((j > 1 && maze[i, j - 2] == 0) && maze[i, j - 1] == 1) // 011 일때 -> 010
                        maze[i, j] = 0;
                }

            }
         
        }
    }

    public void AllocateBlocks(int[,] maze)
    {
        position = Fposition;
        for (int j = 0; j < MAXWIDTH; j++)
        {
            for (int i = 0; i < MAXHEIGHT; i++)
            {
                if (maze[i, j] != 0)
                {
                    InstantiateBlock();
                    
                }
                position = position + new Vector3(0, -Y, 0);
            }
            position = Fposition + new Vector3(X * (j + 1), 0, 0);
        }
    }

    public void InstantiateBlock()
    {
        GameObject block = (GameObject)Instantiate(BlockPrefab, position, Quaternion.Euler(new Vector3(0, 0, 0)));
        blocksmade.Add(block);
    }





